import React from 'react';

import '../styles/menu-items.scss';

const MenuItem = ({ title, imageUrl }) => (
    <div className='menu-item'>
                <div style={{
                    backgroundImage:`url(${imageUrl})`
                }}
                className='content'>
                    <h2 className='title'>
                        {title}
                        {imageUrl}
                    </h2>
                    <span className='subtitle'>
                        Shop Now
                    </span>
                </div>
            </div>
);

export default MenuItem;
